INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51992, 0, 'Flucytosine', 'Bone Marrow Failure Disorders', 'Flucytosine may frequently cause bone marrow toxicity, which can be irreversible and fatal in immunosuppressed patients.  Flucytosine should be used with extreme caution in patients with preexisting bone marrow suppression.  Frequent blood counts are recommended.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51993, 0, 'Flucytosine', 'Kidney Diseases', 'Flucytosine must be given with extreme caution to patients with impaired renal function.  Flucytosine is excreted primarily by the kidneys, and renal impairment may lead to accumulation of the drug.  Serum concentrations of the drug should be monitored to determine the adequacy of renal excretion in such patients.  Dosage adjustments should be made in patients with renal insufficiency to prevent progressive accumulation of active drug.  Close monitoring of renal, hematologic and hepatic function in all patients is recommended.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51994, 0, 'Flucytosine', 'Diseases requiring hemodialysis', 'Flucytosine is substantially removed by hemodialysis and should be administered after dialysis.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51995, 0, 'Flucytosine', 'Hypokalemia', 'Flucytosine may cause hypokalemia.  Patients with preexisting hypokalemia should be monitored closely for worsening electrolyte disturbances during therapy with flucytosine.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51996, 17327, 'Aminosalicylic acid', 'Kidney Diseases', 'The use of aminosalicylic acid is contraindicated in patients with severe renal impairment.  Both aminosalicylic acid and its acetyl metabolite are primarily eliminated by the kidney, and the latter tends to accumulate extensively in patients with renal failure.  Some accumulation may also occur in patients with lesser degrees of renal dysfunction.  Caution is advised when aminosalicylic acid is used in these patients.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51997, 17328, 'Aminosalicylic acid', 'Kidney Diseases', 'The use of aminosalicylic acid is contraindicated in patients with severe renal impairment.  Both aminosalicylic acid and its acetyl metabolite are primarily eliminated by the kidney, and the latter tends to accumulate extensively in patients with renal failure.  Some accumulation may also occur in patients with lesser degrees of renal dysfunction.  Caution is advised when aminosalicylic acid is used in these patients.', '3', '', 'DDInter', 0);
